import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from 'react-router-dom';

import Painel from './../pages/Painel';

const AppRoutes = () => (
    <Router>
        <Switch>
            <Route path="/" component={Painel} exact />
        </Switch>
    </Router>
);

export default AppRoutes;
